import React from "react";
import Product from "./component/Product";
import CustomCard from "./component/Card"; // Renamed to avoid conflict
import Dashboard from "./component/Dashboard";
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbarpanel from './component/Navbarpanel';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbarpanel />
        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/products" element={<Product />} /> {/* Assuming you want to navigate to products */}
          <Route path="/card" element={<CustomCard />} /> {/* Ensure route matches intended usage */}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
